/*Table structure for table `shared_delivery_method` */

DROP TABLE IF EXISTS `shared_delivery_method`;

CREATE TABLE `shared_delivery_method` (
  `id` bigint(20) NOT NULL,
  `name` varchar(16) NOT NULL,
  `defaultLogisticsCorpId` bigint(20) NOT NULL,
  `firstWeight` decimal(24,2) DEFAULT NULL,
  `continueWeight` decimal(24,2) DEFAULT NULL,
  `firstPrice` decimal(24,4) DEFAULT NULL,
  `continuePrice` decimal(24,4) DEFAULT NULL,
  `enabled` int(11) NOT NULL,
  `orderNo` int(11) NOT NULL,
  `description` varchar(128) DEFAULT NULL,
  `createUser` varchar(32) NOT NULL,
  `createDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modifyUser` varchar(32) DEFAULT NULL,
  `modifyDate` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_defaultLogisticsCorpId` (`defaultLogisticsCorpId`),
  CONSTRAINT `FK_defaultLogisticsCorpId` FOREIGN KEY (`defaultLogisticsCorpId`) REFERENCES `shared_logistics_company` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='配送方式表';

