/*Table structure for table `shared_log_config` */

DROP TABLE IF EXISTS `shared_log_config`;

CREATE TABLE `shared_log_config` (
  `id` bigint(20) NOT NULL,
  `tenantId` bigint(20) NOT NULL,
  `className` varchar(64) NOT NULL,
  `methodName` varchar(16) NOT NULL,
  `operation` varchar(16) DEFAULT NULL,
  `enabled` int(11) DEFAULT '0',
  `description` varchar(128) DEFAULT NULL,
  `createUser` varchar(32) NOT NULL,
  `createDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modifyUser` varchar(32) DEFAULT NULL,
  `modifyDate` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='系统日志配置表';

