/*Table structure for table `shared_payment_method` */

DROP TABLE IF EXISTS `shared_payment_method`;

CREATE TABLE `shared_payment_method` (
  `id` bigint(20) NOT NULL,
  `name` varchar(16) NOT NULL,
  `type` varchar(32) NOT NULL COMMENT 'online-在线支付，offline-线下支付',
  `enabled` int(11) NOT NULL,
  `orderNo` int(11) NOT NULL,
  `description` varchar(128) DEFAULT NULL,
  `createUser` varchar(32) NOT NULL,
  `createDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modifyUser` varchar(32) DEFAULT NULL,
  `modifyDate` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='支付方式表';

