/* Procedure structure for procedure `sp_wop_module_move_node` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_wop_module_move_node` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sp_wop_module_move_node`(id bigint,targetId bigint,out resultCode int,out resultMessage varchar(64))
ExitLabel:BEGIN
	/* 强烈注意，变量名不要与字段名相同 */
	declare leftId int; /* 左节点ID */
	declare rightId int; /* 右节点ID */
	declare pid bigint; /*节点的父ID*/
	declare lvl int; /* 节点的Level */
	declare targetLeftId int; /* 目标节点的左节点ID */
	declare targetRightId int; /* 目标节点的右节点ID */
	declare targetLevel int; /* 目标节点的Level */
	declare diff int; /* 差值*/
	declare levelDiff int; /* Level差值*/
	declare groupIdStr varchar(5000); /*待移动小树杈的节点列表*/
	/*设置编码，解决中文乱码*/
	set character_set_results = utf8;
	/* 查询要移动的节点,变量名不能与字段名一样 */
	select `leftValue`,`rightValue`,`parentId`,`level`
	into leftId,rightId,pid,lvl
	from `wop_module`
	where `wop_module`.`id`= id;
	/*leftId不为空*/
	if leftId is null then
		set resultCode = 1002;
		set resultMessage = "要移动的节点不存在";
		LEAVE ExitLabel;
	end if;
	if leftId = 1 then
		set resultCode = 1003;
		set resultMessage = "根节点不能移动";
		LEAVE ExitLabel;
	end if;
	if id = targetId then
		set resultCode = 1004;
		set resultMessage = "不能移动到自己";
		LEAVE ExitLabel;
	end if;
	/* 如果目标ID是要移动节点的父节点，不需要移动(同级认为无顺序)*/
	if pid = targetId then
		set resultCode = 1000; /*认为是成功操作*/
		set resultMessage = "目标节点是要移动节点的父节点，不需要移动";
		LEAVE ExitLabel;
	end if;
	/* 查询要移动的节点,变量名不能与字段名一样 */
	select `leftValue`,`rightValue`,`level`
	into targetLeftId,targetRightId,targetLevel
	from `wop_module`
	where `wop_module`.`id`= targetId;
	if targetLeftId is null then
		set resultCode = 1006;
		set resultMessage = "目标节点不存在";
		LEAVE ExitLabel;
	end if;
	if targetLeftId > leftId and targetLeftId < rightId then
		set resultCode = 1007;
		set resultMessage = "目标节点不能是要移动节点的子节点";
		LEAVE ExitLabel;
	end if;
	/*---------------开始更新-------------------------*/
	start transaction;
    
	/* 保存小树杈的ID值*/
	select  group_concat(CAST(`id` as char)) as idStr
	into groupIdStr
	from `wop_module`
	where `leftValue` between leftId and rightId;
        
	/* 目标节点在右边 */
	/* 目标节点是当前节点所在路径上的节点的话，比较特殊，与移动到右侧节点的处理相同 */
	if targetLeftId>leftId or (targetLeftId < leftId and targetRightId > rightId) then
		/*目标节点的当前right值-1就是移动节点的新right值*/
		set diff = targetRightId - 1 - rightId; /*左右值的差值*/
		set levelDiff = targetLevel + 1 - lvl; /*Level的差值*/
        
		/* 更新小树杈的left、right和level*/
		update `wop_module` 
		set `leftValue`=`leftValue` + diff,
		`rightValue`=`rightValue` + diff,
		`level` = `level` + levelDiff
		where `leftValue` between leftId and rightId;
            
		/* 更新移动节点的父ID */
		update `wop_module` 
		set `wop_module`.`parentId` = targetId
		where `wop_module`.`id`= id; 
        
		/*插入位置左侧的节点的left值和right值要减小*/
		set diff = rightId-leftId+1;
        
		/* left>移动节点原right值 and left<目标节点原right值，并且不是小树杈上的节点*/
		update `wop_module` 
		set `leftValue`=`leftValue`- diff 
		where `leftValue`> rightId and `leftValue`< targetRightId
		and not FIND_IN_SET(CAST(`id` as char),groupIdStr);
            
		/* right>移动节点原right值 and right<目标节点原right值，并且不是小树杈上的节点*/
		update `wop_module` 
		set `rightValue`=`rightValue`- diff 
		where `rightValue` > rightId and `rightValue`< targetRightId
		and not FIND_IN_SET(CAST(`id` as char),groupIdStr);
	else
		/* 目标节点在左边 */
		/*目标节点的当前right值就是移动节点的新left值*/
		set diff = leftId - targetRightId; /*左右值的差值*/
		set levelDiff = targetLevel + 1 - lvl; /*Level的差值*/
        
		/* 更新小树杈的left、right和level*/
		update `wop_module` 
		set `leftValue`=`leftValue` -diff,
		`rightValue`=`rightValue` - diff,
		`level` = `level` + levelDiff
		where `leftValue` between leftId and rightId;
        
		/* 更新移动节点的父ID */
		update `wop_module` 
		set `wop_module`.`parentId` = targetId
		where `wop_module`.`id`= id; 
        
		/*插入位置右侧的节点的left值和right值要增大*/
		set diff = rightId-leftId+1;
        
		/* left>目标节点原right值 and left<移动节点原right值，并且不是小树杈上的节点*/
		update `wop_module` 
		set `leftValue`=`leftValue`+ diff 
		where `leftValue`>targetRightId and `leftValue`< rightId
		and not FIND_IN_SET(CAST(`id` as char),groupIdStr);
            
		/* right>=目标节点原right值 and right<移动节点原right值，并且不是小树杈上的节点*/
		update `wop_module` 
		set `rightValue`=`rightValue`+ diff 
		where `rightValue`>=targetRightId and `rightValue`< rightId
		and not FIND_IN_SET(CAST(`id` as char),groupIdStr);
	end if;
    
	/* 成功 */
	commit;
	set resultCode = 1000;
	set resultMessage = "节点移动成功";
    END */$$
DELIMITER ;

